<!DOCTYPE html>
<html>

  <head>
    <script data-require="jquery@3.1.1" data-semver="3.1.1" src="https://ajax.googleapis.com/ajax/libs/jquery/3.1.1/jquery.min.js"></script>
    <link rel="stylesheet" href="style.css" />
    <script>
    window.onmessage = function(event) {
  console.log("event:"+event.data);
  var dataObj =JSON.parse(event.data);
  if(dataObj.event == "reportPageLoaded") {
    removePlaceholder(getIframeElement(event.source));
  }
};

function getIframeElement(srcWindow) {
  var frames = document.getElementsByTagName('iframe');
    for (var i=0; i < frames.length; i++) {
        if (frames[i].contentWindow === srcWindow) {
            return frames[i];
        }
    }
}

function removePlaceholder(iframeElem) {
  $(iframeElem).parent().children('.iframe_placeholder').remove();
}

function removeMe(num) {
  console.log("attampting removal of placeholder #"+num);
  var selector = "#container"+num+" > .iframe_placeholder";
  $(selector).remove();
}
</script>
<style>
.container {
  position: relative;
  width: 800px;
  height: 600px;
  border: 1px solid #DDDDDD;
}

.click_to_interact {
  padding: 10px;
  position: absolute; 
  bottom:10%;
  left:10% ; 
  background: rgba(0,0,0,0.5); 
  color: #FFF;
  transition: all 150ms ease;
}

.click_to_interact:hover {
  background: rgba(0,0,0,0.9); 
}

.container>iframe {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  z-index: 0;
}

.iframe_placeholder {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  z-index: 10;
  background-color: rgba(66,0,255,0.5);
}
